          "body": "<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">India is one of the most socially active countries, yet there is a lot of disconnect between the people living in the same locality.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Localized news is a massive opportunity, but mostly in Print form. Print is considered an authentic source of local content. it reaches 42 Cr people, but is constrained by Accessibility and lacks a social / community discussion.</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Digital platforms on the other hand have a community to discuss and dissent, but lack authenticity or actionability - focusing more on sensational content.</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">The Indian consumer is comfortable with both mediums (Print and digital video), which opens up a great opportunity for a neighbourhood platform that has the authenticity of print, ease of access through video content, highly actionable by empowering people to express themselves and also, where the local utility can be accessed.</span></p><p><br></p>",
