          "image1": "https://sateeq-v2.s3.ap-south-1.amazonaws.com/Pitch/incluzon/incluzon-7.png",
          "body": "<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Incluzon charges commission from the recruiter to license their Saas. For students, the company uses a freemium model wherein it provides few features for free and charges money for a different set of features. The other streams of revenue are monetizing add-on services, campus placement portal, B2B learning and development, community monetization. </span></p>",
