          "body": "<p>We have been teaching students in around 10 countries for the last 12 plus years. We have been teaching 25 different subjects and 500 plus different courses. Before the Covid outbreak, we were used to teach on a part-time basis due to involvement in other businesses. During the lockdown, we tried to invest more time into it and found out that this industry is huge and undiscovered. Before we had around 100 students and were earning around 12 lakhs annually. After lockdown, our student base increased to 750 and our earnings have also increased to 70 lakhs annually with no spending on marketing. Right now we want to create an online marketplace platform (Website and mobile app) where anyone can teach and learn anything. Initially to create goodwill and good brand value we want to focus mainly on subjects we are already teaching. by hiring some good experts for the subjects. Later on, we want to be the amazon in the learning industry. To develop a platform and a team and to market the website, we need an investment of INR 20 million.</p><p><span style=\"color: rgb(34, 34, 34);\">We have been doing it for the last 13 years; we have done it before, during and after the pandemic. Before the pandemic, we indulged more in our other business, so we did it part-time. During the pandemic, when there was a complete lockdown, we focused only on this business for 3 months. We used to teach only 2-3 hours before the pandemic. During the pandemic, we taught for more than 12 hours a day. I know many such start-ups are drying up and losing a lot of money. I think that is because they spent a lot on marketing and paying salaries to their top management. Till now we have spent nothing on marketing and acquiring&nbsp;students and professionals. We have always focussed on delivering the best work possible. We have got more than 750 learners just by word of mouth promotion. Neither we want to be the unicorn and this is the second last round of investment we will be raising. We have enough experience and materials that we can fund our company by the revenue we generate. No big companies are unicorns which includes Facebook, google, amazon, tesla and others.</span></p>",
