          "body": "<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Collection process in India is very slow and tedious causing huge bad debts to various industries. Moreover, companies have to spend a lot of money on building a collection team which then constantly reminds the customers and suppliers to pay their dues in time. Such conventional recovery systems have existed for a long time and need some advancements in their fast paced business environment. </span></p><p><br></p>",
