          "body": "<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Saarthi.ai is a pre-trained multilingual Conversational AI company focused on Collections. It makes the lives of CROs and Collections Managers easy through Pravid – AI-powered Collections SaaS to put collections on autopilot with omnichannel communication for the entire debt lifecycle, along with timely nudges, legal notices, psychology-based pre-tested Collection Strategies and actionable insights.</span></p><p><br></p>",
